compressionLevel: mixed

enableGlobalCache: false

enableImmutableInstalls: false

npmPublishAccess: public

packageExtensions:
  "@swc-node/sourcemap-support@*":
    dependencies:
      tslib: "*"
  css@*:
    dependencies:
      fs: "*"
  debug@*:
    dependencies:
      supports-color: "*"
  express@*:
    dependencies:
      ejs: "*"
  webpack@*:
    peerDependencies:
      webpack-cli: "*"

yarnPath: .yarn/releases/yarn-4.6.0.cjs
